INSERT INTO `promotions` (`id`, `product_id`, `active`, `category`, `title`, `description`, `created`, `modified`, `image`, `url`) VALUES
	(1, 1, 1, 'Discount', 'mySafetyValet', 'Your Key to Safer Driving   By participating in this program, youll become a safer driver and well reward you with lower auto insurance premiums.', '2013-05-23 07:46:56', '0000-00-00 00:00:00', 'auto_icon.jpg', ''),
	(2, 1, 1, 'Discount', 'Accident-Free', 'It can pay to be a good driver. In certain states, youre eligible for a discount if youve insured your vehicle with American Family Insurance for at least three consecutive years without an accident. ', '2013-05-23 07:47:17', '0000-00-00 00:00:00', 'auto_icon.jpg', ''),
	(3, 1, 1, 'Discount', 'Auto & Home ', 'Save money when you bundle your auto and home insurance with American Family. ', '2013-04-23 08:09:51', '0000-00-00 00:00:00', 'auto_icon.jpg', ''),
	(4, 1, 1, 'Discount', 'Auto & Life', 'You can save money on your auto insurance premiums if you or any of your household family members have both auto and life insurance policies with American Family Insurance and American Family Life Insurance Company.', '2013-04-23 08:09:52', '0000-00-00 00:00:00', 'auto_icon.jpg', ''),
	(5, 1, 1, 'Discount', 'Teen Safe Driver Program', 'Have a teen driver in your house? American Familys Teen Safe Driver Program is an innovative way to help teens make better choices behind the wheel. In-car and online technology lets you and your teen see their risky driving behavior and learn how to correct it.\r\n', '2013-05-23 07:48:01', '0000-00-00 00:00:00', 'auto_icon.jpg', ''),
	(6, 1, 1, 'Discount', 'Personal Liability Umbrella Insurance', 'Get extra liability protection with American Family umbrella insurance coverage, and save money with discounts, too. Availability and eligibility requirements vary by state and policy terms.', '2013-04-23 08:09:58', '0000-00-00 00:00:00', 'auto_icon.jpg', ''),
	(7, 1, 1, 'Discount', 'Auto Rental Reimbursement', 'Having an accident can be stressful enough. Dont let out-of-pocket rental car expenses add to your anxiety. Auto Rental Reimbursement coverage from American Family helps pay for a rental vehicle when yours is being repaired.', '2013-05-23 07:48:25', '0000-00-00 00:00:00', 'auto_icon.jpg', ''),
	(8, 1, 1, 'Discount', 'Emergency Road Service', 'When you\'re stranded on the highway or in your driveway you have enough to worry about. Determining where help will come from shouldn\'t be your concern. American Familys Emergency Road Service coverage can help get you and your vehicle back on the road.', '2013-05-20 08:29:58', '0000-00-00 00:00:00', 'auto_icon.jpg', ''),
	(9, 6, 1, 'Discount', 'Cycle & Home', 'You may qualify for a money-saving discount for insuring your cycle and home together, multiple cycles or certain types of touring cycles.', '2013-04-19 09:23:44', '0000-00-00 00:00:00', '', ''),
	(10, 6, 1, 'Discount', 'Additional Coverage  Option', 'Emergency Road Service', '2013-04-19 09:23:46', '0000-00-00 00:00:00', '', ''),
	(11, 6, 1, 'Discount', 'Additional Coverage  Option ', 'Personal Liability Umbrella Insurance', '2013-04-19 09:23:47', '0000-00-00 00:00:00', '', ''),
	(12, 3, 1, 'Discount', 'Home & Auto', 'In contrast to the Auto & Home discount, which involves a reduction in your auto premium at slightly different rates, this discount allows you to potentially save between 10 and 23 percent on your homeowners, condo or renters premium. Manufactured homes in Georgia and Washington are eligible, too.', '2013-04-23 08:11:29', '0000-00-00 00:00:00', 'homeowners_icon.jpg', ''),
	(13, 3, 1, 'Discount', 'Home Security and Fire Protection', 'If your home is equipped with a qualifying smoke/fire alarm system, a burglar alarm or an automatic sprinkler system, you may receive a 3 to 20 percent insurance discount on your property policy.', '2013-04-23 08:11:31', '0000-00-00 00:00:00', 'homeowners_icon.jpg', ''),
	(14, 3, 1, 'Discount', 'Home & Umbrella', 'You may qualify for an insurance discount on your homeowners, renters or condominium policy when you purchase the additional liability protection of an American Family Umbrella Policy.', '2013-04-23 08:11:33', '0000-00-00 00:00:00', 'homeowners_icon.jpg', ''),
	(15, 3, 1, 'Discount', 'Personal Liability Umbrella Insurance', 'Get extra liability protection with American Family umbrella insurance coverage, and save money with discounts, too. Availability and eligibility requirements vary by state and policy terms.\r\n', '2013-04-23 08:11:34', '0000-00-00 00:00:00', 'homeowners_icon.jpg', ''),
	(16, 3, 1, 'Discount', 'Identity Theft', 'American Family Insurance has partnered with Identity Theft 911, an industry leader in identity fraud resolution, to give you and your family 24/7 access to a variety of valuable features and services, including the option of working one-on-one with a dedicated fraud specialist. These experienced professionals provide you with the guidance you need to recover from identity theft, or at your request, proactive measures to help you avoid being victimized in the future.', '2013-05-06 15:12:52', '0000-00-00 00:00:00', 'homeowners_icon.jpg', ''),
	(17, 2, 1, 'Discount', 'Home & Auto', 'In contrast to the Auto & Home discount, which involves a reduction in your auto premium at slightly different rates, this discount allows you to potentially save between 10 and 23 percent on your homeowners, condo or renters premium. Manufactured homes in Georgia and Washington are eligible, too.', '2013-04-23 09:32:42', '0000-00-00 00:00:00', 'renters_icon.jpg', ''),
	(18, 2, 1, 'Discount', 'Home Security and Fire Protection', 'If your home is equipped with a qualifying smoke/fire alarm system, a burglar alarm or an automatic sprinkler system, you may receive a 3 to 20 percent insurance discount on your property policy.', '2013-04-23 09:32:45', '0000-00-00 00:00:00', 'renters_icon.jpg', ''),
	(19, 2, 1, 'Additional Coverage Option', 'Personal Liability Umbrella Insurance', 'Get extra liability protection with American Family umbrella insurance coverage, and save money with discounts, too. Availability and eligibility requirements vary by state and policy terms.', '2013-04-23 09:32:47', '0000-00-00 00:00:00', 'renters_icon.jpg', ''),
	(20, 5, 1, 'Discount', 'Auto & Life', 'You can save money on your auto insurance premiums if you or any of your household family members have both auto and life insurance policies with American Family Insurance and American Family Life Insurance Company.', '2013-04-23 08:12:53', '0000-00-00 00:00:00', 'life_icon.jpg', ''),
	(21, 7, 1, 'Additional Coverage Option', 'Commercial Liability Umbrella Policy', 'Picks up where your underlying business insurance liability coverage ends, giving you added protection against the financial consequences of major accidents or incidents.', '2013-04-23 08:14:07', '0000-00-00 00:00:00', 'motorcycle_icon.jpg', ''),
	(22, 8, 0, 'Discount', 'Business', 'Coming soon', '2013-05-17 14:53:27', '0000-00-00 00:00:00', 'business_icon.jpg', ''),
